import React, { useState } from "react";
import "./App.css";
import Utility from "./function/utility"
import LoginPage from "./pages/LoginPage";

export default function App() {

  const [user, setUser] = useState([]);

  const getUserInfo = (userdata) => {

    setUser(userdata)
  };
  const testFetch =()=>{
      Utility.checkAccessTokenExpiresIn().then((v)=>{
        console.log(v);
        const request = {
          method: "POST",
          url: "test",
          body: JSON.stringify({ test:"tere" }),
          ContentType: "application/json; charset=UTF-8",
          "Authorization": `Bearer ${1}`,
        };

        Utility.FetchRequest(request).then((result)=>{

          console.log(result);
        }).catch(err=>{
          console.log(err.error);
          alert("something went wrong ")
        })
      })
      .catch(err=>{
        console.log(err);
      })
  }
  return (
    <div>
      {user.length === 0 ? (
        <div>
          <LoginPage getUserInfo={getUserInfo} />
        </div>
      ) : (
        <div>
       <button onClick={()=>testFetch()}>3232</button>
       </div>
      )}
    </div>
  );
}
